import React from 'react';
import {CardMedia, Grid, Paper} from "@material-ui/core";
import StudentIcon from "../../../assets/student.png"

const SearchStudentSection = props => {
  return (
    <Grid container style={{ marginTop: 16 }}>
      <Grid item xs={4} />
      <Grid item xs={4}>
        <Grid container>
          <Grid item xs={12}>
            <Paper style={{ borderRadius: "50%", ...styles.cardMedia, height: 150, width: 150 }} elevation={4}>
              <CardMedia style={{ ...styles.cardMedia, position: "relative", top: 16 }} image={StudentIcon} />
            </Paper>
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
}

const styles = {
  cardMedia: {
    height: "120px",
    width: "120px",
    marginLeft: "auto",
    marginRight: "auto"
  }
}

export default SearchStudentSection;
